import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import {fetchAllReportsType} from '../redux/reportType/actions';
import {ListGroup}  from 'react-bootstrap';



const ListReportsTypeOfRegion = () => {

    const userRegion = localStorage.getItem("userRegion")

    const disptach = useDispatch();
	const reportsType = useSelector(state => state.reportType.reportsTypeOfRegion)

	useEffect(() => {
		disptach(fetchAllReportsType());
	},[disptach]);

	const data = [['Task', 'Hours per Day']]

	reportsType.map(repType => {
		return data.push([repType.reportType,repType.count])
		
	});

    return (
        < div className='list-latest-players' >
            <ListGroup>
                {reportType.map((repType, index) =>
                    <div key={index} className='mb-2 list'>
                            <ListGroup.Item key='index'>
                                {repType.reportType}
                            </ListGroup.Item>
                    </div>
                )}
            </ListGroup>
        </div >
    );
};

export default ListReportsTypeOfRegion;
